import Img2 from '../images/복리후생2.png';
import styles from './Aboutaone.module.css';


const Aboutaone8 = () => {
    return (
    <div>
       
            <Top />
            <div className={styles.down}>주요고객사</div>
            <div class = "container">
           <h2> 주요고객사</h2>


            </div>
            <Bottom />
        </div>
    );
};

export default Aboutaone8;
